import React from 'react'
import {Switch, Route} from 'react-router-dom'
import Login from './auth/Login'
function Body(){
    return (
        <section>
            <Switch>
                <Route path="/login" component={Login} exact></Route>
            </Switch>
        </section>
    )
}


export default Body
